import React from 'react'
import { useFormik } from 'formik'

function YoutubeForm() {

    const formik = useFormik({
        initialValues: {
            name: '',
            email: '',
            channel: ''
        }
    });

    console.log("Formik values", formik.values)

    return (
        <div>
            <form>
                <label htmlFor='name'>Name</label>
                <input 
                    type='text' 
                    id='name' 
                    name='name' 
                    value={formik.values.name} 
                    onChange={formik.handleChange} 
                    autoComplete="off"
                />

                <label htmlFor='email'>E-mail</label>
                <input 
                    type='email' id='email' name='email' value={formik.values.email} onChange={formik.handleChange} autoComplete="off"/>

                <label htmlFor='channel'>Channel</label>
                <input type='text' id='channel' name='channel' value={formik.values.channel} onChange={formik.handleChange} autoComplete="off"/>

                <button>Submit</button>
            </form>
        </div>
    )
}

export default YoutubeForm
